void eissource_error_create(struct component_s *com)
{
  if (com != NULL)
    {
      com->in_num    = 0;
      com->out_num   = 7;
      com->op_num    = 1;
      com->in        = NULL;
      com->out       = malloc(com->out_num * sizeof(void *));
      com->op        = malloc(com->op_num  * sizeof(void *));
      com->out[EISSOURCE_ACC0]   = mossfw_output_create(EISSOURCE_ACC_OUTPUTTYPE);
      com->out[EISSOURCE_GYR0]   = mossfw_output_create(EISSOURCE_GYR_OUTPUTTYPE);
      com->out[EISSOURCE_LINE0]  = mossfw_output_create(EISSOURCE_LINE_OUTPUTTYPE);
      com->out[EISSOURCE_ACC1]   = mossfw_output_create(EISSOURCE_ACC_OUTPUTTYPE);
      com->out[EISSOURCE_GYR1]   = mossfw_output_create(EISSOURCE_GYR_OUTPUTTYPE);
      com->out[EISSOURCE_LINE1]  = mossfw_output_create(EISSOURCE_LINE_OUTPUTTYPE);
      com->out[EISSOURCE_OFFSET] = mossfw_output_create(EISSOURCE_OFFSET_OUTPUTTYPE);
      *com->op = mossfw_callback_op_create(eissource_operate_cb, 0, false);
    }
}

void eissource_error_delete(struct component_s *com)
{
    component_delete(com);
}
